eryone deserves dignity and fair treatment in the workplace.'=>'Quhem Nora Winslow Keene dhe jam një avokate e përkushtuar ndaj interesit publik. Duke jetuar në Denver, Kolorado, kam harxhuar vite të tëra në mbrojtje të të drejtave të punonjësve të keqpërfaqësuar. Si një e diplomuar në Universitetin e Stanfordit, luajta një rol kyç në sigurimin e mbrojtjeve kritike për punonjës të bujqësisë, duke siguruar rroga më të mira dhe mbulim shëndetësor. Puna ime është përqendruar në ngritjen e zërit për drejtësi mjedisore dhe përmirësimin e cilësisë së jetës për bashkësitë rurale. Çdo çështje që marr përsipër çohet përpara nga besimi se cilido meriton dinjitet dhe trajtim të drejtë në vendin e punës.','Example heading in pattern.Hey,'=>'Hej,','Pattern descriptionA pattern for a CV/Bio landing page.'=>'Një model për faqe mirëseardhjeje për një CV/Jetëshkrim.','Pattern titleCV/bio'=>'CV/Jetëshkrim','Subscribe to get notified when our website is ready.'=>'Që të njoftoheni kur të jetë gati sajti ynë, pajtohuni.','Something great is coming soon'=>'Diçka e bukur vjen së shpejti','Event'=>'Veprimtari','Pattern descriptionA full-width cover banner that can be applied to a page or it can work as a single landing page.'=>'Një banderolë mbulesë, me gjerësi të plotë, që mund të aplikohet mbi një faqe, ose mund të funksionojë si një faqe njëshe mirëseardhjeje.','Pattern titleComing soon'=>'Së shpejti','Pattern descriptionA business homepage pattern.'=>'Një model për faqe hyrëse biznesi.','Pattern titleBusiness homepage'=>'Faqe hyrëse biznesi','Pattern descriptionA section with overlapping images, and a description.'=>'Një ndarje me mbivendosje figurash dhe një përshkrim.','Pattern titleOverlapping images and paragraph on right'=>'Mbivendosje figurash dhe paragrafi djathas','More posts'=>'Më tepër postime','Pattern descriptionDisplays a list of posts with title and date.'=>'Bën shfaqjen e një liste postimesh me titull dhe datë.','Pattern titleMore posts'=>'Më tepër postime','C